import Cookies from "js-cookie";
import { getPost } from "../api/PostApi"

export const getPosts = (token)=> async(dispatch) => {
    try {
        const {data} = await getPost(token)
        console.log(Cookies.get('token'));
        dispatch({type:'getPost',payload:data})   
    } catch (error) {
        alert("Jopa")
    }
}
